import React from "react";
import './IndexBody.css';

export default function IndexBody() {
    const [loaded, setLoaded] = useState(false);

    useEffect(() => {
        // Dopo il montaggio del componente, imposta lo stato a true dopo un breve ritardo
        const timeout = setTimeout(() => {
            setLoaded(true);
        }, 100);

        // Pulisci il timeout nel caso in cui il componente venga smontato prima che scatti
        return () => clearTimeout(timeout);
    }, []);
    return (
        <>
            <div id="container">
                <div className="top-part">
                    {/* <img className="top_image" src={require("../../images/image_home_1.jpg")} alt="NON VA NULLA EHEAD" /> */}
                </div>
            </div>
        </>
    );
}
